        React.createElement("path", { d: "M13 10a1 1 0 00-1.79-.62v.01a4.52 4.52 0 01-.2.23 13.26 13.26 0 01-3.02 2.52A1 1 0 009 13.86c.77-.46 1.44-.97 1.99-1.44V22a1 1 0 102 0V10zm4.7 6.3a1 1 0 00-1.4 1.4l1.79 1.8-1.8 1.8a1 1 0 001.42 1.4l1.79-1.79 1.8 1.8a1 1 0 001.4-1.42l-1.79-1.79 1.8-1.8a1 1 0 00-1.42-1.4l-1.79 1.79-1.8-1.8z", fill: primaryFill }));
};
const Multiplier1X32Regular = wrapIcon(rawSvg({}), 'Multiplier1X32Regular');
export default Multiplier1X32Regular;
